import './App.css';

const App = () => {
  const name = null;
  const isNameShowing = false;
  return (
    <div className="App">
      <h1>Hello {isNameShowing ? name : 'someone'} ! </h1>
      { name ? (
        <>
          <h1>{name}</h1>
        </>
      ) : (
        <>
          <h2>no name</h2>
        </>
      )
      }
    </div>
  );
}

export default App;
